import React from 'react'

import './styles.css'

const Text = (props) => {

    const { list } = props

    return (
        list.map(text => (

            <div key={text.key} id={text.id} className="text-center">
                <h3>{text.titulo}</h3>
                <p>{text.paragrafo1}</p>
            </div>
        ))
    )
}

export default Text
